import React from "react";

function MainDiv({ messages }) {
  return (
    <div className="message-container">
      {messages.map((msg, index) => (
        <div key={index} className="message">
          <strong>{msg.sender}</strong>: {msg.text}
        </div>
      ))}
    </div>
  );
}

export default MainDiv;
